create table stu_info
(
    s_id       varchar(20)   not null comment '学号',
    s_name     varchar(30)   null comment '姓名',
    s_sex      varchar(10)   null comment '性别',
    s_colleges varchar(50)   null comment '所在院校',
    s_class    varchar(50)   null comment '行政班级',
    s_tel      varchar(20)   null comment '手机号',
    isdel      int default 0 not null comment '逻辑删除',
    constraint s_id
        unique (s_id)
)
    comment '学生信息表';

alter table stu_info
    add primary key (s_id);

